import axios from "axios";
import { useState, useEffect } from "react";
import styles from "../CSS/Crops.module.css";

function Crops() {
  const [data, setData] = useState();
  let [toRender, setToRender] = useState(0);
  function reRender() {
    if (toRender == 0) setToRender(1);
    else setToRender(0);
  }
  useEffect(() => {
    axios
      .get("http://localhost:3002/crops")
      .then((result) => {
        setData(result);
        console.log(result.data);
      })
      .catch((err) => {
        console.log("error in axios crop get");
      });
  }, [toRender]);

  return (
    <div>
      {data.map((x) => {
        <table>
          <tbody>
            <tr>
              <td>Name:</td>
              <td></td>
            </tr>
            <tr>
              <td>Type:</td>
              <td></td>
            </tr>
            <tr>
              <td>Suitable Soil:</td>
              <td></td>
            </tr>
            <tr>
              <td>Suitable Climate:</td>
              <td></td>
            </tr>
            <tr>
              <td>Suitable Season:</td>
              <td></td>
            </tr>
          </tbody>
        </table>;
      })}
    </div>
  );
}

export default Crops;
